import React, { Component } from "react";
import TareasList from "./TareasList";

export default class Seccion extends Component {
  render() {
    return (
      <div>
        <h2 style={{ "font-weight": "bold" }}>{this.props.title}</h2>
        <TareasList tareas={this.props.tareas} />
      </div>
    );
  }
}
